import './App.css';
import {BrowserRouter,Routes,Route} from 'react-router-dom';

function App() {
  return (
    <div>
        <BrowserRouter>
        <Routes>
          <Route path='/'>Home</Route>
          <Route path='/about'>About</Route>
          <Route path='login'>Login</Route>
        </Routes>
        </BrowserRouter>
    </div>
  );
}

export default App;
